    function checked_sub_t_int256(x, y) -> diff {
        x := cleanup_t_int256(x)
        y := cleanup_t_int256(y)
        diff := sub(x, y)

        // underflow, if y >= 0 and diff > x
        // overflow, if y < 0 and diff < x
        if or(
            and(iszero(slt(y, 0)), sgt(diff, x)),
            and(slt(y, 0), slt(diff, x))
